css:
.styleguide {
  position: relative;
  overflow: auto;
}
.styleguide section.collapsed {
  opacity: .6;
  padding-top: 10px;
  padding-bottom: 10px;
}
.styleguide section.collapsed:hover {
  opacity: 1;
}
.styleguide section.collapsed > .section-heading {
  display: block;
  margin: 0;
}
.styleguide section.collapsed > * {
  display: none;
}
.styleguide section .section-heading {
  cursor: pointer;
  font-weight: bold;
  color: #ffffff;
}
.styleguide section .section-heading:hover {
  color: #ffffff;
  font-weight: bold;
  cursor: pointer;
}
.styleguide section[data-name="styleguide"] {
  border-top: none;
  padding-top: 0;
}
.styleguide .overlay,
.styleguide .popover-list {
  position: relative;
}
.styleguide .select-list .editor.mini,
.styleguide .popover-list .editor.mini {
  height: 27px;
}
.styleguide .tooltip {
  position: relative;
  opacity: 1;
  display: inline-block;
  margin-right: 10px;
}
.styleguide .btn-collapse-all {
  position: absolute;
  right: 10px;
  top: 10px;
  z-index: 100;
}
.example {
  display: -webkit-flex;
  border: 1px solid rgba(0, 0, 0, 0.5);
  border-radius: 2px;
  margin: 10px 0;
}
.example > * {
  width: 50%;
}
.example .example-rendered {
  position: relative;
  padding: 10px;
  background: #222426;
  border-radius: 2px 0 0 2px;
}
.example .example-rendered .ui-site-1,
.example .example-rendered .ui-site-2,
.example .example-rendered .ui-site-3,
.example .example-rendered .ui-site-4,
.example .example-rendered .ui-site-5 {
  height: 10px;
  width: 100px;
}
.example .example-code {
  position: relative;
  background-color: #002b36;
  border-top: 1px solid #222426;
  border-right: 1px solid #222426;
  border-bottom: 1px solid #222426;
}
.example .example-code.show-example-space-pen .example-space-pen {
  display: block;
}
.example .example-code.show-example-html .example-html {
  display: block;
}
.example .example-code .btn-group {
  position: absolute;
  top: 10px;
  right: 10px;
  z-index: 10;
}
.example .example-code .btn-group .btn.selected {
  background-color: #222;
}
.example .example-code .editor {
  background-color: transparent;
  display: none;
  border: none;
  -webkit-user-select: text;
  padding: 10px;
  border-radius: 0 2px 2px 0;
}
.example .example-code .editor > div {
  line-height: 1.4;
}
